	(49, 7, '', 3, 'z_chto', 'z_chto', 'Отдаваемая вещь', '', '', 'При возможности укажите марку отдаваемой вещи. В случае с электроникой, бытовой техникой, инструментом нам будет проще вести реестр пожертвованных вещей и не запутаться в похожих или одинаковых наименованиях.', '', 'z_chto', 0, 0, '', 0, '', '', 1, '', 1, 0, 0, 0, '', 600),
