	(53, 7, '', 1, 'z_ves', 'z_ves', 'Примерный вес (кг)', 'f_chislo_float', '', 'Десятые и сотые доли килограмма можно указать через точку', '', 'z_ves', 0, 0, '', 0, '', '', 1, '', 1, 0, 0, 0, '', 1000),
	(54, 7, '', 4, 'z_photo', 'z_photo', 'Фото', '', '', 'Добавьте фото (на данный момент добавить можно 1 фотографию)', '', 'z_photo', 0, 0, '', 0, '', '', 1, '', 0, 0, 0, 0, '', 650),
	(55, 7, '', 3, 'z_data_vremya', 'z_data_vremya', 'Когда можно забрать', '', '', 'Наберите текст. Желательно указывать даты и время в следующем виде для удобной обработки заявки:\r\n\r\n- если есть возможность отдать вещь в одно и то же время в диапазоне дат, например, с понедельника по пятницу после 18.00. \r\n\r\nПример: с 31 мая (пон) по 4 июня (пятн) после 18.00 до 20.00\r\n\r\n- если есть возможность отдать вещь в определенные дни в определенное время. \r\n\r\nПример: 5 июня (суб) с 14.00 до 18.00; 6 июня (воскр) с 17.00 до 20.00; 7 июня (пон) с 9.00 до 12.00', '', 'z_data_vremya', 0, 0, '', 0, '', '', 1, '', 1, 0, 0, 0, '', 1200),
	(56, 7, '', 2, 'z_vigruzka', 'z_vigruzka', 'Выгрузка до машины ОХЧ', '', '', 'Укажите, как будет выгружена отдаваемая вещь до машины Один Хороший Человек. Огромная просьба - пожалуйста, по возможности выносите вещи до машины сами, потому что вещи у нас забирает обычно один человек, если он будет выгружать всё сам, то его просто не хватит на несколько заявок подряд в день.\r\n\r\n- вещь до машины выгрузит ее владелец (Тот, кто отдает вещь)\r\n\r\n- владелец вещи поможет Одному Хорошему Человеку выгрузить вещь до машины │Совместно (помогу выгрузить)│\r\n\r\n- владелец не сможет выгрузить вещь до машины или помочь с ее выгрузкой (Тот, кто забирает вещь)', '', 'z_vigruzka', 4, 0, '', 0, '', '', 2, '', 1, 0, 0, 0, '', 520),
	(57, 7, '', 2, 'z_sposob_trans', 'z_sposob_trans', 'Способ транспортировки', '', '', 'Вы можете вывезти вещь самостоятельно на один из наших складов (Вывоз своим транспортом) или мы вывезем ее при помощи своего транспорта и транспорта компаний, оказывающих нам поддержку (Вывоз транспортом ОХЧ).\r\n\r\nПри самостоятельной транспортировке вещи с вами свяжется наш руководитель склада и подскажет, в какое время можно подъехать, чтобы отдать вещь.\r\n\r\nПри вывозе транспортом ОХЧ с вами так же свяжется участник нашей команды, чтобы сделать контрольный звонок и точно согласовать дату и время.', '', 'z_sposob_trans', 5, 0, '', 0, '', '', 2, '', 1, 0, 0, 0, '', 510),
	(58, 7, '', 1, 'z_cena_nov', 'z_cena_nov', 'Цена (нов), руб.', 'f_chislo_float', '', 'Если вы можете, то укажите примерную стоимость новой вещи (или подобной), которую вы хотите отдать. Так нашему оператору будет проще обрабатывать заявки, потому что при помощи нуждающимся есть более дорогие вещи, которые сложны в приобретении, и мы отреагируем на такие заявки в первую очередь.', '', 'z_cena_nov', 0, 0, '', 0, '', '', 1, '', 0, 0, 0, 0, '', 1500),
	(59, 7, '', 1, 'z_cena_bu', 'z_cena_bu', 'Цена (б/у), руб.', 'f_chislo_float', '', 'Если вы можете, то укажите примерную стоимость б/у вещи (или подобной), которую вы хотите отдать. Так нашему оператору будет проще обрабатывать заявки, потому что при помощи нуждающимся есть более дорогие вещи, которые сложны в приобретении, и мы отреагируем на такие заявки в первую очередь.', '', 'z_cena_bu', 0, 0, '', 0, '', '', 1, '', 0, 0, 0, 0, '', 1600),
	(60, 7, '', 3, 'o_comment', 'o_comment', 'Комментарий', '', '', 'Если есть какая-то важная информация или подробности, которые вы хотите указать, но которые не подошли ни в одно стандартное поле, то укажите их здесь.', '', 'o_comment', 0, 0, '', 0, '', '', 1, '', 0, 0, 0, 0, '', 1700),
