	(68, 7, '', 3, 'z_address_ext', 'z_address_ext', 'Откуда забрать (Адрес)', '', '', 'Укажите адрес дома, номер подъезда, офиса, домофон (телефон, если домофон неисправен или его нет) или код для входа и другие необходимые подробности.\r\n\r\nНапример: ул.Коммунистическая 46, вход с торца здания (со стороны кольца), подвальный этаж, домофон 77, офис №1 «Один Хороший Юрист».', '', 'z_address_ext', 0, 0, '', 0, '', '', 1, '', 1, 0, 0, 0, '', 1250),
