INSERT INTO `version_log` (`id`, `dt`, `version`, `comment`) VALUES
	(1, '01.10.2021 17:20', '1.38', '-Добавлено ведение версий. Текущая версия отображается в подвале сайта. Выставлена версия 38 - по кол-ву коммитов в репозитории на сегодняшний день.\r\n\r\n-Добавлена кнопка перехода (стрелка рядом с полем по аналогии с маршрутом) из заявки на доставку в участника\r\n\r\n-Добавлен вывод блока зависимых заявок в редактор контрагента, для перехода обратно из участника в заявку\r\n\r\n-Уменьшен шрифт формы вывода данных об объекте (Редактрование объектов, фильтры)\r\n\r\n-Расширена анкета задачи в соответствии с договоренностями\r\n\r\n-Расширены фильтровые поля в соответствии с полями задачи\r\n\r\n-Расширена таблица листинга в соответствии с полями задач\r\n\r\n-Пофиксен баг "невлезания таблицы листинга" на малых разрешениях экрана. Теперь все адаптивно - таблица скролится до конца\r\n\r\n-Добавлены проекты в соответствии с файлом\r\n\r\n-Разработан вид листинга объектов - "Тривиальная структура". Применена в листинге проектов\r\n\r\n-Добавлена возможность создания и сортировки проектов\r\n\r\n-В свойства проекта добавлено иерархичное поле-список "Родительский проект"\r\n\r\n-Подключен, описан и отлажен иерархионный фильтр проектов в листинге задач (При выборе проекта или подпроекта - отображаются задачи находящиеся ниже по выбранной ветке\r\n\r\n-Проработано поле "Проект" в свойствах задачи. Представлен в виде иерархического списка проектов\r\n\r\n-В колонку "Структура" таблицы листинга задач добавлен вывод положения в иерархии проектов'),
	(2, '12.10.2021 14:30', '1.39', '-Добавлена страница управления группами пользователей (Добавлен одноименный пункт главного меню). Листинг групп отражен в виде дерева, по аналогии с листингом проектов\r\n\r\n-Добавлен функционал управления группами пользователей (Создание, редактирование, удаление, сохранение истории)\r\n\r\n-Создан типа поля - список с возможностью выбора нескольких значений. Добавлено поля "Группы пользователя" в участника, задействуя данный тип, для возможности привязки участника к группам\r\n\r\n-Добавлено две базовые группы "Администраторы системы", "Пользователи"'),
	(3, '14.10.2021 15:00', '1.40', '-Добавлен вывод участников в иерархии групп на странице управления группами и пользователями. Участник отличается от группы жирным шрифтом. При клике на него - переходим на страницу его редактирования.\r\n\r\n-Добавлена кнопка "К группам" на странице редактирования участника\r\n\r\n-Тип полей "Постановщик", "Ответственный", "Наблюдатели" в объекте "Задача" изменен на "Выпадающий иерархионный список", содержащий иерархию групп и пользователей. На данный момент можно назначить в данные поля одно значение, либо группу, либо пользователя. В дальнейшем расширим возможности для указания нескольких групп и/или пользователей\r\n\r\n-Настроен вывод значений полей "Постановщик", "Ответственный", "Наблюдатели" в таблице листинга задач\r\n\r\n-Изменен тип одноименных фильтров в листинге задач. Отлажена работа данных фильтров. Работает аналогично фильтру проектов, только на распространяется пользователей.\r\n\r\n-Отлажено отображение вывода истории изменений данных полей\r\n\r\n-Отлажено отображение вывода истории изменений поля "Проект" объекта "Задача"\r\n\r\n-Отлажено отображение вывода истории изменений поля "Группы участника" объекта "Участник"\r\n\r\n-Реализована связь проектов с группами и пользователями. Добавлено 3 поля в анкету проекта: Администратор проекта, Ответственные по проекту, Наблюдатели проекта'),
	(4, '03.11.2021 23:00', '1.41', '-В систему добавлен новый тип объектов - "Заявки на лазертаг". В главное меню добавлен пункт - "Лазертаг". Создана страница листинга заявок на лазертаг, страница редактирования заявок на лазертаг. В объект добавлены обговоренные поля.\r\n\r\n-На страницу редактирования участника добавлен список заявок на лазертаг, привязанных к данному участнику. Сделано по аналогии со списком заявок на доставку, привязанных к участнику\r\n\r\n-В анкету участника добавлена кнопка "Позвонить". Отображена справа от телефона участника\r\n\r\n-Создана "внешняя" форма для возможности создания заявки на Лазертаг из "вне"\r\n\r\n-Проработан алгоритм отправки заявки на лазертаг. Добавлен критерий уведомления администраторов о создании новой заявки на лазертаг. В объект "Заявка на лазертаг" добавлено новое поле: Номер заявки - генерируется автоматически. Так же добавлен одноименный фильтр в листинг заявок на лазертаг, а так же поле "№" в таблицу листинга заявок на лазертаг. Добавлена обговоренная отбивка клиенту при создании заявки на лазертаг с указанием номера заяки\r\n\r\n-Пункт главного меню "Заявки" переименован в "Доставка"\r\n\r\n-Исправлена опечатка "Завяки" на странице редактирования участника\r\n\r\n-Анкета участника расширена. Добавлены поля, присутствующие в заявке на лазертаг (Страница в ВК, Адрес, Удобное время звонка). Отлажено обновление полей анкеты участника при подаче заявки. Если анкета с таким номером телефона уже есть, то поля (Фамилия, Имя, Отчество и т.д.) Будут заменены на новые указанные в заявке данные, если эти данные не нулевые (то бишь заполнены). В истории изменения анкеты участника эти изменения будут числиться за пользователем "Заявки БотАпи".\r\n\r\n-В заявку на лазертаг добавлены 2 поля "Участвует в ПП" и "Участвует в ПП". В листинг заявок на ЛТ добавлены одноименные фильтры и одноименные колонки в таблицу вывода.\r\n\r\n-АПИ Форма подачи заявки на ЛТ модернезирована. Добавлена зафиксированная надпись. Изменена сортировка полей, исходя из договоренностей.\r\n\r\n-В листинг заявок добавлена генерация пердварительного и окончательного плана игры. В генерации участвуют заявки в данный момент отображенные на экране с указанием меток "Участвует в ПП" и "Участвует в ОП", а так же указанными идентификаторами времени для ПП (Идентификатор времени ЗЧ) и для ОП (Идентификатор времени КЗ). Данные для подсчета кол-ва участников берутся из одноименных полей ЗЧ для ПП и КЗ для ОП. Обновление выгрузил, но еще нуждается в доработке. Есть вопрос по поводу следующих входящих данных: мин. участников, макс. участников, начало, окончание - нужно определиться как их будем забивать. У меня есть предложение :) нужно обсудить :)'),
	(5, '07.11.2021 19:15', '1.42', '-Поправил баг открытия главного меню на странице листинга заявок на Лазертаг. Так как поля ПП и ОП фиксированы, они перекрывали фиксированное меню.\r\n\r\n-Добавлен автоподсчет общего количества участников по ЗЧ и КЗ в заявке на ЛТ\r\n\r\n-Добавлен скролл на поля ПП и ОП в листинге заявок на ЛТ (Дебагинг)\r\n\r\n-В управляющее меню листинга заявок на лазертаг добавлен пункт "Настройки". Создана форма настроек, вызывается вышеописанной кнопкой. Форма позволяет сохранить минимальное и максимальное количество участников, а так же задать 10 временных интервалов. Если настройки не изменены - используются настройки по умолчанию: 8-24 участников, 12:00-17:00 десять интервалов времени по 30 минут\r\n\r\n-Общий багфиксинг'),
	(6, '07.11.2021 19:45', '1.43', '-Внутренний багфиксинг'),
	(7, '12.11.2021 15:50', '1.44', '-В заявку на ЛТ добавлено новое поле "Готовность к общей игре" (Выпадающий список - Да, Нет). Соответствующая колонка добавлена в таблицу листинга заявок на ЛТ. Так же добавлен одноименный фильтр. В api форме заявки - не отражено\r\n\r\n-Настройки планирования игр ЛТ модернизирваны. Настройки разделены на 2 типа - для ПП и ОП\r\n\r\n-В api-форму заявки на ЛТ добавлено поле "Адрес проведения игры". Обязательно для заполнения. Назначена необходимая всплавающая подсказка. В таблице листинга заявок на ЛТ поля "Что сделать", "Дата", "Примечание" перемещены в конец таблицы. После колонки "Статус" добавлены два новых столбца "Адрес игры (ЗЧ)" (Адрес игры, в заявке от человека) и "Адрес игры (НН)" (Адрес игры, назначенный нами). В форму заявки на ЛТ добавлены 2 одноименных поля. Поля "Что сделать", "Дата", "Примечание" так же перемещены в конец формы. В фильтры листинга заявок на ЛТ так же добавлены 2 одноменных фильтра. Фильтры "Что сделать" и "Дата" так же спущены вниз формы.\r\n\r\n-Ширина столбцов листинга заявок на ЛТ отрегулирована. Выставлена по минимуму на столбцах где это возможно. Дальнейшее регулирование (Фиксация шапки, первых столбцов и т.п.) будет выполнено в рамках одноименной задачи\r\n\r\n-В главное меню добавлен пункт "Обновления". В систему добавлен соответствующий раздел. Раздел содержит историю версий.');
